describe("getVisibleParent",function(){var e,r;beforeEach(function(){r=document.createElement("div"),r.style.width="200px",r.style.height="200px",document.body.appendChild(r),e=L.map(r,{maxZoom:18}),e.fitBounds(new L.LatLngBounds([[1,1],[2,2]]))}),afterEach(function(){document.body.removeChild(r)}),it("gets the marker if the marker is visible",function(){var r=new L.MarkerClusterGroup,t=new L.Marker([1.5,1.5]);r.addLayer(t),e.addLayer(r);var a=r.getVisibleParent(t);expect(a).to.be(t)}),it("gets the visible cluster if it is clustered",function(){var r=new L.MarkerClusterGroup,t=new L.Marker([1.5,1.5]),a=new L.Marker([1.5,1.5]);r.addLayers([t,a]),e.addLayer(r);var n=r.getVisibleParent(t);expect(n).to.be.a(L.MarkerCluster),expect(n._icon).to.not.be(null),expect(n._icon).to.not.be(void 0)}),it("returns null if the marker and parents are all not visible",function(){var r=new L.MarkerClusterGroup,t=new L.Marker([5.5,1.5]),a=new L.Marker([5.5,1.5]);r.addLayers([t,a]),e.addLayer(r);var n=r.getVisibleParent(t);expect(n).to.be(null)})});